description:
Adam and Eve are dating, as you have never seen it before. A number of brave singles embarks on a cross-border and innovative attempt to find love. The participants have been through a thorough match-making process, and now they meet their potential partner on a beautiful, deserted island. But the assembly meeting is literally without filter, the participants meet each other completely naked. Can the naked truth, they lowered the parades and the wonderful surroundings help love on the way? And what happens when unexpected guests arrive on the island and challenge the blazing romance?

Video: MPEG4 Video (H264), 1920x1080, 25 fps, 7000 kbps
Audio: Dolby AC3, 48000 Hz, stereo, 192 kbps

